import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
export default function PlacePage(){
    const {id}=useParams()
    const[places,setPlaces]=useState(null);
    useEffect(()=>{
        if(!id){
            return;
        }
        axios.get(`/place/${id}`).then(response=>{
            setPlaces(response.data)
        })
    },[id])

    return(
        <div>
            place page: {id}
        </div>
    )
}
